    Description: '**About the Book**\r\n\r\n___\r\n\r\n___\r\n\r\nKen Sanders Rare Books is pleased to present a presentation by James M. Aton,\r\n\r\n___\r\n\r\non his most recent book, *The Art and Life of Jimmie Jones*. In a dynamic slide show,\r\n\r\n___\r\n\r\nJames M. Aton will take the audience through Jimmie Jones\' remarkable life and art, focusing on his signature achievements: his stunning landscapes of southern Utah and the Grand Canyon. These pieces of art are the focus of James\' most recent book, *The Art and Life of Jimmie Jones; Landscape Artist of the Canyon Country*.\r\n\r\n___\r\n\r\nThe book has recently won two awards: The Evans Handcart Award for biography from the Mountain West Center at Utah State University and “Best Art Book of the Year from 15 Bytes, Utah’s Art Magazine.\r\n\r\n___\r\n\r\n___\r\n\r\n**About James M. Aton**\r\n\r\n___\r\n\r\n___\r\n\r\nJames M. Aton has been a professor of English at Southern Utah University\r\n\r\n___\r\n\r\nfor 36 years. He teaches classes in Writing, Mythology, American Studies, and Continental European Literature. He has published six book on the Colorado Plateau, two of them about Jimmie Jones. In addition, he has produced the film\r\n\r\n___\r\n\r\n(with Jon Smith) *Jimmie Jones: Redrock Painter*. Aton has published articles on environmental history in *Utah Historical Quarterly*, *Western American Literature, South Dakota Review,* and *Southwest Art*.',
