    Description: 'Lucius is a triple-threat of vocal harmonies, infectious hooks, and dance-inducing percussion. Pair those traits with the band’s irresistible live show and it’s easy to see why *NPR Music* calls Lucius “a fabulous band playing such infectious pop songs.” Charismatic co-founders and lead vocalists Jess Wolfe and Holly Laessig sing in unison uniquely delivering songs with stories told from the same perspective. Multi-instrumentalists Dan Molad and Peter Lalish round out the quartet.\r\n\r\nMarch 2016 brought the release of *Good Grief*, the band’s sophomore effort and the follow-up to 2013’s successful debut*Wildewoman*. The lead song “Born Again Teen,” was described as “ebullient” by  *Rolling Stone*. Time Out has called Lucius “an indie-pop revelation"\r\n\r\nWolfe and Laessig met in 2005 while attending Berklee College of Music. Since forming, Lucius has toured extensively, playing headline shows and major festivals including Bonnaroo, Austin City Limits, Lollapalooza and Newport Folk Festival. Additionally they have collaborated with the likes of Jeff Tweedy, David Byrne and Roger Waters and have toured with The Decemberists, My Morning Jacket, Jack White and more.',
