    Description: 'Through a variety of practices, materials, and concepts, this exhibition* *explores how visual artists use three-dimensionality as a language to simultaneously celebrate and defy traditional systems of structure. Beyond the tired dichotomy of architecture and landscape—or not-architecture and not-landscape—this exhibition looks to the outer terms of exclusion where sculpture lies. By reimagining art historical notions of form, space, and process, the artists presented in *Object[ed]: Shaping Sculpture in Contemporary Art* cleverly and skillfully illuminate the realms between painting and sculpture, objectivity and subjectivity, as well as production and consumption. \r\n\r\nArtist List: Olga Balema, Caitlin Cherry, Lizze Määttälä, Leeza Meksin, Tove Storch, Gili Tal',
