    Description: 'Each piece of my artwork comes from a memory. My pieces represent a place, moment, or an experience that I try to capture. Through my own photographs, a loved one’s photo, or an image that evokes an emotion, each painting has a place and time connected to it. My artwork tells the story of my life. It takes me back to the place where my grandfather spent his last weeks, where my husband learned to love people in a distant land, where a close cousin and friend had a baby, and sometimes to where I find beauty in the least expected places. By creating a permanent image on canvas, I am able to share with others a perspective from a corner of my mind where love, inspiration, and light reside.',
