    Description: 'This month we showcase an extraordinary impressionist / tonalist scene by American artist LeConte Stewart.  Stewart found beauty in the understated, honest, and quiet landscapes of the autumn, perhaps his favorite time to paint.  *The Old Homestead *brilliantly captures the poignancy and charm of a Kaysville rural scene.  The clucking chickens and drying laundry are somewhat unusual genre elements for the artist, and along with the flawlessly blue sky draw the viewing into one of the most captivating images Stewart ever painted. It belongs in a league with some of the best American regional paintings ever produced.\r\n___\r\n\r\n___\r\nPlease visit the gallery to see this painting and request a catalog for our current exhibition, **Western Landscapes 1859 - 1978**.',
