    Description: 'Do you ever wonder why yoga and other mindfulness practices have such a wonderful effect on your mind and body? Current brain research shows that by focusing our attention in particular ways, we can rewire the brain to support the mental states of happiness, love, wisdom and compassion. That means:\r\n\r\nA calmer, less reactionary mind\r\n\r\nImproved memory, attention and mood\r\n\r\nDecreased anxiety and depression\r\n\r\nStrengthened immune, digestion and hormone function\r\n\r\nDeeper relationships and social connections\r\n\r\nEach week we will explore different brain functions and work with practices that support and improve those functions. Through short lectures and mindfulness practices such as meditation, pranayama, restorative poses and guided imagery, you will learn how to rewire your brain.\r\n\r\nTogether, we will learn how to influence the brain, so that our minds and bodies feel healthier, happier and more at ease.',
