    Description: 'We are honored to partner with the National Ability Center for their annual luncheon benefiting our war veterans. CLICK HERE for more information about how to register for this event.\r\n\r\nThe ***Saluting Our Heroes Luncheon*** honors the men and women who have served our country, while building awareness of the needs of returning service members. The event highlights opportunities and resources available in Utah to assist veterans as they transition back to civilian life. *There is no cost to guests to attend this event. In order to help U.S. service members discover their abilities, a minimum donation of $100 is kindy requested.*\r\n\r\nPre-order ***Tribe: On Homecoming and Belonging*** today, by either calling the store at 801-484-9100 or ordering online.',
