    Description: 'Every Wednesday night is our weekly Wiseguys Open Mic night. This is the night to see the 20 to 25 of the best local, amateur and professional comedians in Utah perform. Not only do we feature great local comedians, but we also have our share of touring comedians who happen to stop by to perform. So, you never know who you may see on Wednesday Wiseguys Open Mic night, but you can always count on an awesome and interesting time! Wiseguys Open Mic is also your chance to try your hand at stand-up comedy. Every comedian that is making a living as a professional started out at open mic and it\'s every Wednesday at Wiseguys at the Gateway in downtown Salt Lake City. If you think you\'re funny and you want to give it a shot then come on down! Maybe you\'re the next Seinfeld...you never know until you get up there and give it a try! Bring your friends. We encourage you to invite lots of people. The more friends you bring the funnier you will seem! We\'ll see you there! Must Be 21+ with Valid ID to Enter.\r\n\r\n*   21+ Show -\r\n\r\n**Live Comedy** : Genre: Rated PG-18',
