    Description: '10th Annual Salt Lake County Watershed Symposium, Nov. 15th, & 16th -- Free, Open to the Public\r\n\r\n \r\n\r\nJoin the conversation about water quality, pollution control and nature protection at the **10th Annual Salt Lake Countywide Watershed Symposium**. Find out what’s being done to make a difference and what you can do! \r\n\r\nSalt Lake County will host this free, two-day event that brings together policy makers, teachers, students, environmental advocates, the public, and those working in water-related professions. Feature presentations, field trips and workshops will explore a broad range of topics, from general interest to technical.\r\n\r\n___\r\n\r\n**When & Where **\r\n\r\n**Presentations & Workshops:          **\r\n\r\nTuesday and Wednesday November 15th and 16th \r\n\r\n*9:00am-4:30pm (check-in starts at 8:00am)*\r\n___\r\n\r\nUtah Cultural Celebration Center\r\n\r\n1355 West 3100 South, West Valley City\r\n\r\n___\r\n\r\n**Film Screening:**\r\n\r\n*November 15*\r\n___\r\n*7:00-8:45pm*\r\n___\r\n*The City Library (Salt Lake City)*\r\n___\r\nWe\'ve partnered with the Utah Film Center to co-host one of their (free) Tuesday night screenings at the City Library. Join us for the Utah debut of *Return of the River!  *\r\n\r\n___\r\n\r\n**Get Involved!**\r\n\r\nReserve an info table for your organization\r\n___\r\nVolunteer to moderate a session\r\n___\r\nShare on Twitter and Instagram!  #WaterSymp2016',
