    Description: '*"I realize that nothing is ever how you imagine.  A hand on your shoulder from someone you love is different than a stranger’s, but it’s not worth explaining because what we are really after is the feeling, not a story. It is about conjuring a feeling to begin a conversation and to continue talking, even if it is with yourself **when you are asleep."*\r\n\r\n___\r\n\r\nAlyce carrier is a Salt Lake City-based artist, her background is in sculpture and ceramics but most recently has started to experiment with printmaking and stop motion animation. Her work is a sparse and delicate treatment of the mundanity of routine and the day to day. It reads like an intimate social encounter; lending insight to a sense of self without abusing sincerity.',
