    Description: 'Paul has been passionate about photography since the early 1980s. Nature, wildlife, and action shots are his favorites. He loves the challenge that arises from the unpredictability of his subjects when he is trying to capture the perfect wildlife moment. He is a native of California but moved to Salt Lake City in July 2013. Mr. Marto grew up in Carmel Valley, CA, so it is no surprise that he gravitated towards wildlife photography. Mountain biking, hiking, tennis, and playing the electric guitar round out the list of pursuits for this U.C. San Diego graduate. He has a beautiful wife and two adorable children.\r\n\r\nPaul’s work has recently been highlighted by *National Geographic*, *USA Today*, *KSL.com*, *Utah.com*, Bolsa Chica Conservancy, Sea & Sage Audubon Society, The Environmental Nature Center, *Orange County Register*, *Irvine World News*, *Focusingonwildlife.com*, and *WildlifePhotographyNews.net*. He is a recent winner of the City of Irvine\'s 40th Anniversary Photo Contest and his works have won numerous online photo contests as well. He has been juried into a number of organizations, including LagunaArt.com, AmericaFineArt.org, Artists of America, Gallery 104, RAWArtists.org and TurningArt.com.',
