    Description: 'Everything about Todd’s fine art—from the process of creation to the finished product—is intimately connected with the fascination the artist has with the different layers that make up a person’s life. Each of us is a sum total of all our experiences, both good and bad: amazing moments, sadness and heartbreak, insecurities, first kisses, the triumphs. These events become our individual life stories — singular, beautiful, sometimes gut-wrenching — but always uniquely "us." We may not be able to see those delicate intangibles of our personal stories, but they are nevertheless real.\r\n\r\nIt is the concept of the "story" that draws Todd to creating art from books. Not only is there a narrative to the book itself, but there is also a separate story of the person who may have owned it. He also uses reclaimed and vintage fabrics, photos, notes and other nostalgic items because he is inspired by the idea that they are real pieces of real lives, and these precious elements can be rediscovered and repurposed to create a new work of art.\r\n\r\nWorking in mixed media allows Todd to savor the "mess," and thoroughly enjoy the process from start to finish. "I love the smell of the old paper and books. I love scouring forgotten basements in old book stores — finding unexpected treasures, then giving them new life. The unique resins I use to finish each work \'freeze\' the elements I have brought together and suspend them in time forever, thereby making one beautiful piece out of many individual stories"—not unlike how we create our own lives.',
