    Description: 'The First World Parliament on Spirituality was initiated and organized by The World United Foundation, headquartered in Hyderabad, India, under the leadership of Dr. Yugandhar.\r\n___\r\nAt the first WPS there were 208 presentations, 60 plenaries, 2800 attendees at the live event, 25 spirituo-cultural activities, and 20 panel discussions.\r\n\r\nAdditionally, participants from 56 nations attended the event. And 42 million people participated in the Universal Meditation Hour on 21st Dec 2012, across the world. People from 165 countries watched the program online.\r\n\r\nThe Second World Parliament on Spirituality is a collaboration between The World United Foundation and Equity United International Foundation, under the leadership of Dr. Paula Fellingham, Founder, Women’s Information Network (www.WomensInformationNetwork.com) and the Global Women’s Association. It will be conducted on 17-21 November, 2016, in Salt Lake City, Utah.\r\n___\r\nPeople of all religions and spiritual schools of thought are welcome!\r\n___\r\nThe goal of the Second World Parliament on Spirituality is to converge the collective wisdom of diverse spiritual thought across the planet and unite to create a Global Peace Initiative and Master Action Plan for Peace for the purpose of increasing the level of love and peace in the world.\r\n\r\nPurposes of the 2016 World Parliament on Spirituality\r\n\r\n• To discuss and develop a Global Peace Initiative regarding how to achieve increased love and peace in the world.\r\n___\r\n• To create a MASTER ACTION PLAN for PEACE that can be implemented in every nation, as we move forward with our Global Peace Initiative.\r\n___\r\n• To explore the underlying commonalities in a multitude of spiritual and holistic diversities.\r\n___\r\n• To share spiritual concepts and practices by inviting leaders of different origins and paths onto a common platform.\r\n___\r\n• To awaken more people from psychological and spiritual slumber.\r\n___\r\n• To reinforce inner-faith unity and highlight the positive and secular side of spirituality.\r\n___\r\n• To spread the concepts of inner transformation, synergistic living, love, peace, and sustained harmony throughout the world.\r\n___\r\n• To help individuals understand various paths of positive thinking and well-being that will help them in their everyday lives.\r\n___\r\n• To guide individuals to choose their paths by presenting various paths of spirituality.\r\n___\r\n• To identify solutions to today’s spiritual challenges.',
