    Description: 'The exhibition, **Just Press Print, **  explores the impact of digital technology on the practices of a visual  artists working in printmaking, a field traditionally associated with  craft skills and mechanical processes. Dispensing with conventional  exhibition formats, the exhibition displays 2D and 3D digital prints  along with sketches, notes and test proofs bundled in bulldog clips that  hang informally from the walls, thereby focusing on the creative  process and not the outcome. 8.30am -5.00pm, Mon thru Fri. 31 Oct thru 25 Nov. Gittins Gallery, Art & Art History Dept, 375 s, 1530 e, University of Utah. info@art.utah.edu.',
