    DateStart: '2016-11-17T12:00:00Z',
    Description: 'The Urban Arts Gallery is proud to present, prolific artist and self-taught\r\n\r\n___\r\n\r\nmusician Jimmi Toro’s exhibit that sheds a brilliant new light on the darkness of mere\r\n\r\n___\r\n\r\nbeing. Combining the creative emotions of vision, sound and movement, Toro’s newest\r\n\r\n___\r\n\r\nexhibit takes the viewer/participant through all the creative senses to view humanity in\r\n\r\n___\r\n\r\nmany forms, as it evolves into what we are all meant to be, creatures of love.\r\n\r\n___\r\n\r\nMusic, Art, &amp; Video is the theme that wraps through the 60 works of art, 6 musical\r\n\r\n___\r\n\r\npieces and 6 video works that Toro has created and invites you to participate in with\r\n\r\n___\r\n\r\nhim. Each piece inspires the other; a song creates a visual image, a painting comes to\r\n\r\n___\r\n\r\nlife in video, and a video becomes a work of art. As you walk through the exhibit you are\r\n\r\n___\r\n\r\ninvited to see and touch the paintings, as well as view each video on a monitor while\r\n\r\n___\r\n\r\nlistening with earphones to the music. A complete immersion in the creative process and\r\n\r\n___\r\n\r\nthe mind of Jimmi Toro.\r\n\r\n___\r\n\r\nToro says “I believe every piece of art, each video viewed, and every song listened to\r\n\r\n___\r\n\r\ncan give off a portion of its original emotion to the listener and observer. Of course, this\r\n\r\n___\r\n\r\nemotional experience can be enhanced by a natural connection to the genre or style of\r\n\r\n___\r\n\r\nthe art. This emotion becomes even more forceful by combining fine art, music, and\r\n\r\n___\r\n\r\nvideo in a way that influences and creates a relationship from one creative offering to the\r\n\r\n___\r\n\r\nother. It can additionally be enhanced by understanding the creative thought and\r\n\r\n___\r\n\r\nexecution process that goes into this work. With that said, my hope is that this triad of\r\n\r\n___\r\n\r\nart, music and video will inspire people to not just understand and appreciate the\r\n\r\n___\r\n\r\ncreative process more, but cause them to think a little deeper about humanity and our\r\n\r\n___\r\n\r\nrelationship to each other, hopefully resulting in a little more respect and a little less\r\n\r\n___\r\n\r\nanger.”\r\n\r\n___\r\n\r\nExhibit runs from November 2 nd – November 27 th 2016\r\n\r\n___\r\n\r\nArtist Reception: November 4 th | 6-9pm\r\n\r\n___\r\n\r\nGallery Stroll: November 18 th | 6-9pm\r\n\r\n___\r\n\r\nGallery Hours: Tues – Sat 12-8pm and Sun 12-6pm. Closed on Mondays\r\n\r\n___\r\n\r\nUrban Arts Gallery: 137 South Rio Grande Street at the Gateway SLC UT',
