    Description: 'We hope you can join us for HEAL\'s very special Tenth Annual Fall Party. \r\n\r\n___\r\n\r\nThe theme of this year\'s party is "A Winning Formula." As you\'ve probably noticed in the tone of our emails lately from HEALandia, we\'re on a roll, with significant victories in all of our campaigns. At the Fall Party, HEAL staff will talk about our accomplishments, the lessons we\'ve learned and what that tells us as we look ahead to the big battles to come. There will also be live music, food from Mazza, access to a cash bar and a great chance to mingle with your fellow HEAL supporters.\r\n\r\n___\r\n\r\nThe venue, the State Room, is a centrally-located small theatre with plentiful parking.\r\n\r\n___\r\n\r\nTICKETS - Purchase at www.healutah.org/FallParty2016\r\n\r\n___\r\n\r\nVIP: $100 (Includes pre-event reception and complimentary drinks for the evening. Reception begins at 5:30 pm).\r\n\r\nRegular: $50\r\n\r\nDiscount: $25 (for students and low income individuals. Please email Hannah Whitney at hannah@healutah.org for a discount code.)\r\n\r\n___\r\n\r\nAll tickets include dinner from Mazza and the program.  A cash bar will also be available.\r\n\r\nDoors, food, and music from 6:30-7:30 pm\r\n\r\nProgram begins at 7:30 pm\r\n\r\n___\r\n\r\nThe State Room is a 21+ venue, and all attendees must have ID.\r\n\r\n___\r\n\r\nBusiness casual or casual dress.',
